                                <p>Sonnet 43 Brew House first opened its taps in 2014. After establishing its core range of beers across the North East and beyond, many awards have followed as this small brewery in Coxhoe, County Durham, continues to push the boundaries of what's possible in small-batch brewing.</p>

								<p>Sonnet 43 Brew House is committed to progressing its taste for drinkers, listening to admirers and critics; the result of which, has been the creation of an evolved range of new and improved recipes launching this year.</p>
