                            <div class="about-text layer-6 skrollable skrollable-between">
                                <p>Using clean and clear line art, we created a beautiful and thought-provoking character inspired by Poe's bird.</p>
                            </div>
                            
                            <div class="about-text layer-7 skrollable skrollable-between">
                                <p>The individual beers each feature an abstract use of colour to make them clearly identifiable, but also reflect Barret Browning's brilliant imagination that once poured freely from her fountain pen.</p>
                            </div>
                            
                            <div class="about-text layer-8 skrollable skrollable-between">
                                <p>The typography has been chosen to amplify the beer's character, both in the story and flavour, in the case of The Raven - dark and captivating.</p>
                            </div>
                            
