                                      <div class="seq-title layer-1 skrollable skrollable-between">
                                        <h2 data-seq><strong>Bourbon Milk Stout</strong><br />The Raven</h2>
                                      </div>
                            			
                                      <div class="seq-title layer-4 skrollable skrollable-between">
                                        <h3 data-seq><strong>EBB Connection...</strong><br />Edgar Allan Poe was an admirer of Barrett Browning's work; so much so, he borrowed the meter from her poem Lady Geraldine's Courtship for his most famous work, The Raven. The bird's feathers' are also an uncanny match for this beguiling stout.</h3><br />
                                     
                                      	<h4 data-seq><strong>Tasting Notes...</strong><br />Oats and a multitude of malts give this sweet stout its sumptuous base. Expect bitter, yet silky chocolateyness from cocoa nibs and chocolate malt, giving way to the smoky sweetness from aging in former bourbon whiskey oak casks.</h4>
                                      </div>
                                      
                                      <div class="seq-graph layer-12 skrollable skrollable-between">
										<svg viewBox="0 0 386 331" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
