                                    <li id="abolition">
                                      <div class="seq-model layer-7 skrollable skrollable-between">
                                        <img data-seq src="/img/casestudy/sonnet/img-pumpclip2.png" alt="Abolition Pump Clip" />
                                      </div>
                                      
                                      <div class="seq-title layer-8 skrollable skrollable-between">
                                        <h2 data-seq><strong>Amber Ale</strong><br />Abolition</h2>
                                      </div>
                                      
                                      <div class="seq-title layer-9 skrollable skrollable-between">
                                        <h3 data-seq><strong>EBB Connection...</strong><br />The daughter of a plantation owner, Barret Browning fiercely opposed slavery. She published poems that condemned the barbarity of slavers and showed her support for the abolition cause.</h3><br />
                                      	<h4 data-seq><strong>Tasting Notes...</strong><br />For all its relatively low alcohol, Abolition's malt bill delivers a full body. The coloured malts also add a slight sweetness as well as the ale's warm amber hue. British hops provide an earthy aroma and mid-range bittering.</h4>
                                      </div>
                                      
