                                      <div class="seq-title layer-8 skrollable skrollable-between">
                                        <h2 data-seq><strong>Pale Ale</strong><br />Aurora</h2>
                                      </div>
                         
                                      
                                      <div class="seq-title layer-9 skrollable skrollable-between">
                                        <h3 data-seq><strong>EBB Connection...</strong><br />Aurora Leigh was the title of Barret Browning's greatly ambitious, nine-book long and somewhat autobiographical poem.</h3><br />
                                      
                                      	<h4 data-seq><strong>Tasting Notes...</strong><br />An abundant malt bill provides good body with complexity and a slight sweetness. With a copious mixture of hops from across the globe delivering an almost botanical feel; it's an earthy yet fresh taste with a subtle bitterness.</h4>	
                                      </div>
                                      
